__NUXT_JSONP__("/items/product_state_scanner", {data:[{slug:"product_state_scanner",text:"\u003Cspan\u003E\u003Cclient-only\u003E\u003Ch1\u003EProduct State Scanner\u003C\u002Fh1\u003E\n\u003Cp\u003E\u003CModInfoCard :img=\"img\" :itemData=\"item\" :title=\"title\" \u002F\u003E\u003C\u002Fp\u003E\n\u003Ch2\u003EDescription\u003C\u002Fh2\u003E\n\u003Cp\u003EProduct State Scanners are tools used for measuring electrical component properties.\u003C\u002Fp\u003E\n\u003Cp\u003EProduct State Scanners will become damaged over time if used to mine or hit mobs. Unlike multimneters, damaged Product State Scanners DO NOT have a corrupted output.\u003C\u002Fp\u003E\n\u003Cp\u003EProduct State Scanners cannot be enchanted or repaired.\u003C\u002Fp\u003E\n\u003Ch2\u003ECrafting Recipe\u003C\u002Fh2\u003E\n\u003Cpre\u003E\u003Ccode\u003Esome code\n\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\n\u003Ch2\u003EMeasurement\u003C\u002Fh2\u003E\n\u003Cp\u003ERight click an electrical block to measure its properties; not all components will have a measurable property.\u003C\u002Fp\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003EBlock\u003C\u002Fth\u003E\u003Cth\u003EProperties measured\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u003CPagesTableLink name=\"Microcontroller Port\" href=\"\u002Fblocks\u002Fmicrocontroller_port\" img=\"block\u002Fmuc_port.png\" \u002F\u003E\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Cul style=\"margin:0\"\u003E\u003Cli\u003EPort id (hex &amp; dec)\u003C\u002Fli\u003E\u003Cli\u003EPort enable \u002F disable\u003C\u002Fli\u003E\u003Cli\u003EPort out \u002F in\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ch2\u003EData Values\u003C\u002Fh2\u003E\n\u003Ch3\u003EID\u003C\u002Fh3\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003EName\u003C\u002Fth\u003E\u003Cth\u003E\u003Ca href=\"https:\u002F\u002Fminecraft.fandom.com\u002Fwiki\u002FNamespaced_ID\"\u003ENamespaced ID\u003C\u002Fa\u003E\u003C\u002Fth\u003E\u003Cth\u003EForm\u003C\u002Fth\u003E\u003Cth\u003ETranslation Key\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003EProduct State Scanner\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Ekontrol:product_scanner\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003Ctd\u003EItem\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Eitem.kontrol.product_scanner\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ch2\u003ETrivia\u003C\u002Fh2\u003E\n\u003Cul\u003E\n\u003Cli\u003EThe product state scanner is a barcode scanner\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003C\u002Fclient-only\u003E\u003C\u002Fspan\u003E",img:"item\u002Fproduct_scanner.png",item:{durability:"24",renewable:"Yes",stackable:0},title:"Product State Scanner"}],fetch:{},mutations:void 0});